import React from 'react'
import { Link, useNavigate } from 'react-router-dom'
import { useSelector } from 'react-redux';
import { getLocal } from '../helpers/auth';
import jwt_decode from "jwt-decode"


function Navbar() {
    const { username } = jwt_decode(getLocal())
    const history = useNavigate()

    const logout = () => {
        localStorage.removeItem('authToken')
        history('/login')

    }
    return (
        <div>

            <nav class="navbar navbar-light bg-light justify-content-between fixed-top">
                <a class="navbar-brand">Nav</a>
                <form class="form-inline">


                    {username && <button onClick={logout} class="btn btn-outline-danger my-2 my-sm-0" type="submit">LOGOUT</button>}
                </form>
            </nav>

        </div>
    )
}

export default Navbar
